  <div class=\"about\">
    <div class=\"container\">
      <div class=\"col-md-6 wow fadeInDown\" data-wow-duration=\"1000ms\" data-wow-delay=\"300ms\">
        <h2>about us</h2>
        <img src=\"{{ asset ('homepage/images/6.jpg')}}\" class=\"img-responsive\" />
        <p>“ZENHOSTING, c’est une société d’hébergement des sites web et boite de
développement informatique ainsi qu’une agence de communication à taille humaine
qui axe sa démarche sur la proximité et la confiance.
Depuis 2011, nous avons développé une clientèle variée composée d’industriels,
d’entreprises de services et aussi de commerçants.”
Nos services ont convaincu des sociétés de toute envergure : des petites et moyennes
entreprises comme des Grands Comptes. 
        </p>
      </div>


      <div class=\"col-md-6 wow fadeInDown\" data-wow-duration=\"1000ms\" data-wow-delay=\"600ms\">
        <h2>CV BUILDER est une application web developpé par ZENHOSTING</h2>
        <p>\tGrâce à l’avancement dans le domaine de développement web, nous constatons que nous avons besoin d’avoir une application web qui répond aux exigence des utilisateurs  et d’avoir des moyens de créer des cv de manière facile et consultable en ligne.

          <p>\tPour augmenter les chances d’employabilité  des candidats, notre solution met à la disposition des employeurs les CVs des utilisateurs et pour  éviter le risque d’avoir une perte de temps à la rechercher des futurs employées. D’ou l’idée de créer une application qui permet de créer des CVs avec un nom de domaine choisis à condition de sa disponibilité et de l’héberger en temps réels. 
          </p>
          <p>Cette application permettra aussi de gérer les CV, gérer les actualités, consulter la liste des CV présent et permettre aux utilisateurs de contacter l’administrateur en cas de besoin. </p>
      </div>
    </div>
